import React from 'react'

const form = (state = [], action) => {
    switch (action.type) {
        case 'BUTTON_CLICKED':
            let button = state.pop();
            if(button){
                console.log(state);

                state = [
                    ...state,
                    {
                        enabled: button.enabled
                    }
                ];
            }

        default:
            return state
    }
};

export default form
